import React from "react";
import {Box, Typography, styled, Button, Stack} from "@mui/material"
import Background from "./../Images/HeroBackground.jpg";
import { breakpoints } from "@mui/system";

const WrapBox = styled(Box)({
    bgcolor: "rgba(20,20,20,1)",
});

const Header = styled(Stack)({
    background: "#BFD200",
    position: "absolute",
    width: "100%",
    minHeight: "2rem",
    [breakpoints.up("sm")]:{
        minHeight: "3.7rem",
    },
});

const Content = styled(Stack)({
    position: "relative",
});

const Handy = styled(Stack)({
    padding:"10px", 
    alignItems: "center",
});

const HeaderContent = styled(Stack)({
    alignItems: "center", 
    gap: 3,
    bgcolor:"#BFD200"
});

const RightOuterBox = styled(Box)({
    background: `linear-gradient(to left, rgba(20, 20, 20,0), rgba(20,20,20,1)),url(${Background})`,
    backgroundSize: "100%",
    backgroundRepeat: "no-repeat",
    height: "100%",
    display: "flex",
    flexDirection: "column",
    alignItems: "space-between"
});

const RightInnerBox = styled(Box)({
    margin: "10%"
});

const StyledButton = styled(Button)({
    background: "#BFD200",
    color: "black",
    borderRadius: "5px",
    fontSize: "1.5rem"
});

const WhiteText = styled(Typography)({
    color: "white",
    whiteSpace:"nowrap",
});

const BigWhiteText = styled(WhiteText)({
    whiteSpace: "nowrap"
});

const GreenText = styled(Typography)({
    color: "#BFD200",
});

//StyledBox als Parent von LeftBox und RightOuterBox?
export default function Hero() {
    return (
        <WrapBox>
            <Header direction="row" display={{sm:"block", xs:"none"}} background= "#BFD200"/>
            <Content direction={{sm:"row", xs:"column-reverse"}}>
                <Handy flex={3}>
                    <img src={require("../Images/handy.png")}
                         height="auto" 
                         width="80%" />
                </Handy>
                <Stack direction="column" flex={7}>
                    <HeaderContent direction="row" bgcolor= "#BFD200">
                        <BigWhiteText sx={{fontSize:{sm:"2.5", xm:"1.5rem"}}}>
                            DEIN DIGITALER 
                        </BigWhiteText>
                        <BigWhiteText sx={{fontWeight:"bold"}}>
                            CO-TRAINER
                        </BigWhiteText>
                    </HeaderContent>
                    <RightOuterBox>
                        <RightInnerBox>
                            <Stack sx={{  display:"flex", 
                                        flexDirection:"column",
                                        alignItems:"flex-end"}}>
                                <GreenText>
                                    COACHING MADE EASY
                                </GreenText>
                                <BigWhiteText sx={{fontSize:{sm:"2.5", xm:"1.5rem"}}}>
                                    MINIMALER AUFWAND.
                                </BigWhiteText>
                                <BigWhiteText 
                                            sx={{fontWeight:"bold"}}>
                                    MAXIMALER ERFOLG.
                                </BigWhiteText>
                                <WhiteText>
                                    Weil der Trainerjob Spaß machen soll!
                                </WhiteText>
                                <StyledButton>
                                    LOS GEHT'S
                                </StyledButton>
                            </Stack>
                        </RightInnerBox >
                        <RightInnerBox>
                            <Stack direction="row" sx={{display:"flex", 
                                                        flexDirection:"row",
                                                        justifyContent:"space-between"}}>
                                <Stack direction="column">
                                    <WhiteText sx={{fontWeight: "bold", fontSize: "1.5rem"}}>
                                        6.000+
                                    </WhiteText>
                                    <WhiteText>
                                        Trainer
                                    </WhiteText>
                                </Stack>
                                <Stack direction="column">
                                    <WhiteText  sx={{fontWeight: "bold", fontSize: "1.5rem"}}>
                                        5 Mio
                                    </WhiteText>
                                    <WhiteText>
                                        Trainings
                                    </WhiteText>
                                </Stack>
                                <Stack direction="column">
                                    <WhiteText  sx={{fontWeight: "bold", fontSize: "1.5rem"}}>
                                        3.000+
                                    </WhiteText>
                                    <WhiteText>
                                        Spiele
                                    </WhiteText>
                                </Stack>
                            </Stack>
                        </RightInnerBox>
                    </RightOuterBox>
                </Stack>
            </Content>
        </WrapBox>
    )
}
